        } catch (error) {
            
        }
    }
    useEffect(() =>{
        GetListCustomer();
    });

    return <Fragment>
    <table class="table table-bordered mt-5 text-center">
        <thead>
        <tr>
            <th>Customer No.</th>
            <th>Surname</th>
            <th>Given Name</th>
            <th>Unit No.</th>
            <th>Street</th>
            <th>City</th>
            <th>Phone Number</th>
            <th>Represented</th>
            <th>Rep Name</th>
        </tr>
        </thead>
        <tbody>
        <tr>
            <td>John</td>
            <td>Doe</td>
            <td>john@example.com</td>
        </tr>
        </tbody>
    </table>
    </Fragment>
};

export default ListCustomer;
